webpackJsonp([0x7c009e39aef8],{5051:function(e,t){e.exports={data:{post:{html:'<p>I haven\'t been doing many updates here... it must be that extra hour per day I spend in traffic on the autobahn A1, waiting to get by that bridge they are fixing.</p>\n<p>I did, however, prepare a couple of pictures for Mama, namely the <a href="http://Mama.editthispage.com/pictures/viewer$64">cat tower</a> and the <a href="http://Mama.editthispage.com/pictures/viewer$68">pregnant bellies</a>. And I was the one who rounded up the cats and put them in the tower. As for the bellies, can you guess which one had twins? (Hint: the twins together weighed less than Christopher at birth.)</p>',fields:{title:"Friday already?",date:"17 Mar 2000",url:"https://papascott.de/2000-03-17-friday-already/"}}},pathContext:{slug:"/2000-03-17-friday-already/",prev:{fields:{title:"Why are they doing road repair on both my routes to work?!?",date:"13 Mar 2000",slug:"/2000-03-13-why-are-they-doing-road-repair-on-both-my-routes-to-work/"}},next:{fields:{title:"Scruffy Saturday",date:"18 Mar 2000",slug:"/2000-03-18-scruffy-saturday/"}}}}}});
